contract A{

uint public a;

constructor(){
a=100;
}

function funA() public {

    a=10;
}

}


contract B is A{

uint public b;

 constructor(){

     b=200;
 }

 function funB() public {

     b=20;
 }

}

contract C is A,B{
// above order of inheritance will start from most base like
// most base like means , one which does not inherit anything
// here A is most base like

}

